import ProjManage from "./Logo.png"

const Projects = () => {
    return (  
        <div className="relative h-screen w-screen bg-slate-300 flex justify-center items-center">
            <a className="absolute top-0" id="Projects"></a>
            <h1 className="absolute pt-10 text-5xl top-10">Projects</h1>
            <div className="relative bg-slate-400 w-5/6 h-4/6 flex">
                <img className="  p-10 h-4/4" src={ProjManage} />
                <p className="text-4xl">ProjManage is a website I developed where users are able to display their projects. The web application utilizes React.js for the frontend, Node.js and Express.js for the backend, and MongoDB for the backend. Users are able to create their accounts secur To find my projects click here</p>
            </div>
        </div>
    );
}

export default Projects;
